import PlaceItem from "./PlaceItem";
import {nanoid} from "nanoid";


export default ({countryList, deleteCountry}) => {
    return(
        <div>
        {countryList.map((country)=>(
            <PlaceItem country={country} key={nanoid()} deleteCountry={deleteCountry}/>
          ))
        }
        </div>
    )

}
